@mixin column($width, $shadow1) {
    width: $width;
    float: left;
    font-family: 'Kanit', sans-serif;
}

@mixin button($width) {
    display: inline-block;
    margin-bottom: 0;
    font-weight: 400;
    text-align: center;
    white-space: nowrap;
    vertical-align: middle;
    -ms-touch-action: manipulation;
