    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    background-color: #b1086d;
    color: #fff;
    width: $width;
}

@mixin sidebar-menu($heighth, $width) {
    height: $heighth;
    width: $width;
    top: 0;
    left: 0;
    background-color: #b4b1b173;
    overflow-x: hidden;
    position: sticky;
